import React, { useState } from "react";
import { Input, Row, Col, Card, Typography, Button, Form } from "antd";

// card
const { Title } = Typography;

function App() {
  const [input, setinput] = useState("");
  console.log(input);
  return (
    <>
    <div className="App">
      <Row justify="center">
        <Col span={24}>
          <Card style={{ height: 100 }}>
            <Title level={1}>Weather App</Title>
          </Card>
        </Col>
      </Row>
      <br />
      <br />
      <Form justify="center" style={{ marginTop: 100 }}>

            <Input placeholder="Enter the city name......" size="large" onChange={(e)=>setinput(e.target.value)}/>
            <br/>
            <Button type="primary" htmlType="submit">
              Search
            </Button>

      </Form>
    </div>
    </>
  );
}

export default App;
